INSERT INTO `catalog_pages` VALUES (33, 209, 'default_3x3', 'neon', 'Neon', 1, 41, 1, 0, 77, '1', '1', '0', '0', '', '', '', 'catalog_neon_header1_en', 'catalog_neon_teaser1_en', 'Die Partygänger freuen sich! Legen Sie den Grundstein und greifen Sie zu Lasern mit der Neon Furniture Serie – alles, was Sie brauchen, um die Party zu beginnen!', '', '');
INSERT INTO `catalog_pages` VALUES (34, 209, 'default_3x3', 'relax', 'Entspannen', 1, 49, 1, 0, 27, '1', '1', '0', '0', '', '', '', 'rela_header_en', 'rela_teaser_en', 'Entspannen Sie sich nach einem ereignisreichen Tag in der Welcome Lounge. Zünden Sie ein paar Kerzen an und entspannen Sie sich bei einer guten Lektüre auf einem Korbstuhl. Wir verstehen die Bedürfnisse eines Wulles mit einem hektischen Lebensstil!', '', '');
INSERT INTO `catalog_pages` VALUES (35, 209, 'default_3x3', 'romantique', 'Romantisch', 1, 50, 1, 0, 93, '1', '1', '0', '0', '', '', '', 'catalog_romantique_headline1', 'catalog_rom_teaser_en', 'Diese süße und dennoch sexuell romantische Serie, die in einer französischen Scheune gefunden wurde, erfüllt die Bedürfnisse aller Frauen. Ich werde mir nur die Nase abstauben!', '', '');
INSERT INTO `catalog_pages` VALUES (36, 209, 'default_3x3', 'scifi', 'Scifi', 1, 53, 1, 0, 99, '1', '1', '0', '0', '', '', '', 'sf_header_en', 'sf_teaser_en', 'Science-Fiction-Convention, Weltraum, Mond, wir haben alles, was Sie brauchen, um hier Ihren eigenen mystischen, nicht-irdischen Raum zu schaffen!', '', '');
